import React from "react";
import "../mainWindow/window.css";

export default function Outlines() {
  return (
    <div className="leftBlocks">
      <div>
        <h1 className="h1">Конспекты</h1>
      </div>
      <div className="outlines">
        <ul className="h1">
          <li>1тема</li>
          <li>2тема</li>
          <li>3тема</li>
        </ul>
      </div>
    </div>
  );
}
